import { Link } from "react-router-dom";

function ItemCard({ name, _id, price, img }) {
  return (
    <div>
      <Link to={`/item/${_id}`}>
        <h3>{name}</h3>
        <p>{`$${price}`}</p>
        <img src={img} alt="pic" />
      </Link>
    </div>
  );
}

export default ItemCard;
